measurements.description:
Nine stately flowers on two up to 27-cm arching inflorescences;
 sepals and petals soft pink-lavender, faded to white basally,
 sepals linear, recurved basally, petals ruffled marginally, prominent midrib;
 lip ruffled, sidelobes closed over column, magenta, light pink picotee,
 two eyes spots rich yellow fading to white, throat light yellow, magenta veins;
 column pale pink, anther cap white, pink spot centrally;
 substance medium; texture crystalline.
